      <h1 className="text-5xl font-bold text-gray-800 mb-6 font-sans">
        Nomi Wellness Dashboard
      </h1>
      
      {/* Glowing Nomi Insight Banner */}
      <div className="max-w-4xl mx-auto mb-8">
