            </div>
          </div>
          
          <div className="relative z-10 mt-4">
            <p className="text-gray-700 text-lg leading-relaxed">
              "Edna's overall wellness is trending positive â€” stable vitals and strong daily engagement. 
              Her consistent patterns show a healthy lifestyle with good emotional connections."
            </p>
          </div>
          
          {/* Subtle glow effect */}
          <div className="absolute -inset-1 bg-gradient-to-r from-blue-400/20 to-indigo-400/20 rounded-2xl blur-sm -z-10"></div>
        </div>
      </div>
    </header>
  );
};

export default NomiHeader;
